
DROP TABLE PARAMETER;

CREATE TABLE PARAMETER
(
	PARAMETER_INDEX 	NUMBER,
	PARAMETER_NAME 		VARCHAR2(120),
	PARAMETER_RYGB		VARCHAR2(120),
	PARAMETER_SYMBOL	VARCHAR2(20),
	PARAMETER_TYPE		NUMBER,
	RESERVED_1			VARCHAR2(120),
	RESERVED_2			VARCHAR2(120),
	PARAMETER_FORMAT	VARCHAR2(30)
);

ALTER TABLE PARAMETER ADD CONSTRAINT PARAMETER_PK PRIMARY KEY (PARAMETER_INDEX);

COMMENT ON TABLE PARAMETER  IS 'PARAMETER';



